  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'Inter', sans-serif;
      background: linear-gradient(135deg, #0a0a0a 0%, #1a1a2e 50%, #16213e 100%);
      min-height: 100vh;
      color: #ffffff;
      overflow-x: hidden;
    }

    .brand-logo {
      position: fixed;
      top: 20px;
      left: 20px;
      z-index: 1000;
      background: linear-gradient(45deg, #ff006e, #8338ec, #3a86ff);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      background-clip: text;
      font-size: 1.8rem;
      font-weight: 700;
      letter-spacing: -0.5px;
      text-shadow: 0 0 30px rgba(255, 0, 110, 0.3);
      animation: glow 2s ease-in-out infinite alternate;
    }

    @keyframes glow {
      from { filter: drop-shadow(0 0 5px rgba(255, 0, 110, 0.3)); }
      to { filter: drop-shadow(0 0 15px rgba(255, 0, 110, 0.6)); }
    }

    .container {
      max-width: 1400px;
      margin: 0 auto;
      padding: 80px 20px 40px;
    }

    .status-indicator {
      display: flex;
      align-items: center;
      justify-content: center;
      margin-bottom: 30px;
      animation: slideDown 0.8s ease-out;
    }

    .live-dot {
      width: 12px;
      height: 12px;
      background: #ff3366;
      border-radius: 50%;
      margin-right: 12px;
      animation: pulse 2s infinite;
      box-shadow: 0 0 10px rgba(255, 51, 102, 0.6);
    }

    @keyframes pulse {
      0% { transform: scale(1); opacity: 1; }
      50% { transform: scale(1.2); opacity: 0.7; }
      100% { transform: scale(1); opacity: 1; }
    }

    .status-text {
      font-size: 1.1rem;
      font-weight: 500;
      color: #ffffff;
      text-transform: uppercase;
      letter-spacing: 1px;
    }

    .player-wrapper {
      position: relative;
      margin-bottom: 40px;
      animation: fadeInUp 1s ease-out;
    }

    .player-container {
      width: 100%;
      max-width: 100%;
      aspect-ratio: 16/9;
      border-radius: 20px;
      overflow: hidden;
      box-shadow: 
        0 25px 50px rgba(0, 0, 0, 0.4),
        0 0 0 1px rgba(255, 255, 255, 0.1),
        0 0 100px rgba(255, 0, 110, 0.1);
      background: #000;
      position: relative;
    }

    .player-container::before {
      content: '';
      position: absolute;
      top: -4px;
      left: -4px;
      right: -4px;
      bottom: -4px;
      background: linear-gradient(45deg, #ff006e, #8338ec, #3a86ff, #00d4aa, #ff006e);
      border-radius: 24px;
      z-index: -1;
      animation: neonGlow 3s linear infinite;
      filter: blur(0px);
    }

    .player-container::after {
      content: '';
      position: absolute;
      top: -2px;
      left: -2px;
      right: -2px;
      bottom: -2px;
      background: linear-gradient(45deg, #ff006e, #8338ec, #3a86ff, #00d4aa, #ff006e);
      border-radius: 28px;
      z-index: -1;
      animation: neonGlow 3s linear infinite reverse;
    }

    @keyframes neonGlow {
      0%, 100% { 
        background: linear-gradient(45deg, #ff006e, #8338ec, #3a86ff, #00d4aa, #ff006e);
        box-shadow: 
          0 0 20px rgba(255, 0, 110, 0.6),
          0 0 40px rgba(255, 0, 110, 0.4),
          0 0 60px rgba(255, 0, 110, 0.2);
      }
      25% { 
        background: linear-gradient(45deg, #8338ec, #3a86ff, #00d4aa, #ff006e, #8338ec);
        box-shadow: 
          0 0 20px rgba(131, 56, 236, 0.6),
          0 0 40px rgba(131, 56, 236, 0.4),
          0 0 60px rgba(131, 56, 236, 0.2);
      }
      50% { 
        background: linear-gradient(45deg, #3a86ff, #00d4aa, #ff006e, #8338ec, #3a86ff);
        box-shadow: 
          0 0 20px rgba(58, 134, 255, 0.6),
          0 0 40px rgba(58, 134, 255, 0.4),
          0 0 60px rgba(58, 134, 255, 0.2);
      }
      75% { 
        background: linear-gradient(45deg, #00d4aa, #ff006e, #8338ec, #3a86ff, #00d4aa);
        box-shadow: 
          0 0 20px rgba(0, 212, 170, 0.6),
          0 0 40px rgba(0, 212, 170, 0.4),
          0 0 60px rgba(0, 212, 170, 0.2);
      }
    }

    #jwplayerDiv {
      width: 100%;
      height: 100%;
      border-radius: 20px;
    }

    .loading-placeholder {
      position: absolute;
      inset: 0;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      background: linear-gradient(135deg, #1a1a2e, #16213e);
      border-radius: 20px;
      z-index: 10;
    }

    .loading-spinner {
      width: 60px;
      height: 60px;
      border: 3px solid rgba(255, 255, 255, 0.1);
      border-top: 3px solid #ff3366;
      border-radius: 50%;
      animation: spin 1s linear infinite;
      margin-bottom: 20px;
    }

    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }

    .loading-text {
      font-size: 1.2rem;
      font-weight: 500;
      color: #ffffff;
      margin-bottom: 8px;
    }

    .loading-subtext {
      font-size: 0.9rem;
      color: #888;
    }

    .match-details {
      background: rgba(255, 255, 255, 0.03);
      backdrop-filter: blur(20px);
      border: 1px solid rgba(255, 255, 255, 0.1);
      border-radius: 20px;
      padding: 30px;
      animation: fadeInUp 1.2s ease-out;
      position: relative;
      overflow: hidden;
    }

    .match-details::before {
      content: '';
      position: absolute;
      top: 0;
      left: 0;
      right: 0;
      height: 3px;
      background: linear-gradient(90deg, #ff006e, #8338ec, #3a86ff);
    }

    .match-title {
      font-size: 1.8rem;
      font-weight: 700;
      color: #ffffff;
      margin-bottom: 20px;
      background: linear-gradient(45deg, #ffffff, #cccccc);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      background-clip: text;
    }

    .detail-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
      gap: 20px;
    }

    .detail-item {
      background: rgba(255, 255, 255, 0.05);
      padding: 20px;
      border-radius: 15px;
      border: 1px solid rgba(255, 255, 255, 0.1);
      transition: all 0.3s ease;
    }

    .detail-item:hover {
      background: rgba(255, 255, 255, 0.08);
      transform: translateY(-2px);
      box-shadow: 0 10px 25px rgba(0, 0, 0, 0.2);
    }

    .detail-label {
      font-size: 0.85rem;
      font-weight: 500;
      color: #888;
      text-transform: uppercase;
      letter-spacing: 0.5px;
      margin-bottom: 8px;
    }

    .detail-value {
      font-size: 1.1rem;
      font-weight: 600;
      color: #ffffff;
      line-height: 1.4;
    }

    .teams {
      font-size: 1.3rem !important;
      background: linear-gradient(45deg, #ff3366, #ff6b9d);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      background-clip: text;
    }

    @keyframes fadeInUp {
      from {
        opacity: 0;
        transform: translateY(30px);
      }
      to {
        opacity: 1;
        transform: translateY(0);
      }
    }

    @keyframes slideDown {
      from {
        opacity: 0;
        transform: translateY(-20px);
      }
      to {
        opacity: 1;
        transform: translateY(0);
      }
    }

    .no-match {
      text-align: center;
      padding: 60px 20px;
      color: #888;
    }

    .no-match h2 {
      font-size: 1.5rem;
      margin-bottom: 10px;
      color: #ffffff;
    }

    /* Mobile Responsiveness */
    @media (max-width: 768px) {
      .brand-logo {
        font-size: 1.4rem;
        top: 15px;
        left: 15px;
      }
      
      .container {
        padding: 70px 15px 30px;
      }
      
      .match-details {
        padding: 20px;
      }
      
      .detail-grid {
        grid-template-columns: 1fr;
      }
      
      .match-title {
        font-size: 1.4rem;
      }
    }

    /* JWPlayer Custom Styling */
    .jwplayer {
      border-radius: 20px !important;
    }

    .jwplayer .jw-controls {
      background: linear-gradient(transparent 60%, rgba(0,0,0,0.2) 85%, rgba(0,0,0,0.4)) !important;
    }

    .jwplayer .jw-controlbar {
      background: rgba(0,0,0,0.3) !important;
      border-radius: 0 0 20px 20px !important;
    }

    .jwplayer .jw-button-color {
      color: #ff3366 !important;
    }

    .jwplayer .jw-progress {
      background: rgba(255, 255, 255, 0.3) !important;
    }

    .jwplayer .jw-buffer {
      background: rgba(255, 51, 102, 0.4) !important;
    }

    .jwplayer .jw-rail {
      background: rgba(255, 255, 255, 0.2) !important;
    }

    .jwplayer .jw-text {
      color: #ffffff !important;
      text-shadow: 1px 1px 2px rgba(0,0,0,0.8) !important;
    }

    .jwplayer .jw-controls-right {
      background: transparent !important;
    }

    .jwplayer .jw-controls-left {
      background: transparent !important;
    }

    /* Reduce control bar opacity when not hovered */
    .jwplayer:not(:hover) .jw-controls {
      background: linear-gradient(transparent 70%, rgba(0,0,0,0.1) 90%, rgba(0,0,0,0.2)) !important;
    }

    .jwplayer:not(:hover) .jw-controlbar {
      background: rgba(0,0,0,0.15) !important;
    }

    /* Ensure video content is crisp and clear */
    .jwplayer .jw-media {
      border-radius: 20px !important;
      filter: none !important;
    }

    .jwplayer video {
      filter: none !important;
    }

    /* Remove any potential blur effects */
    .jwplayer * {
      backdrop-filter: none !important;
    }
  </style>
